import React from "react";
import styled from "styled-components";

export const Content = styled.div`
  width: 15%;
  height: 50%;
  background: black;
  margin: 30px;
`;

export default function CardContent({ newData }) {
  return (
    <>
      <Content>
        {newData.filter((el) => el[0] === 1)}
        <div>{newData.filter((el) => el[0] === 1)}</div>
        <div></div>
        <div></div>
      </Content>
      ;
    </>
  );
}
